    private void doLogin() {
        try {
            sleep(1000);
            System.out.println("Logining...");

            Point browserLocation = webBrowser.getNativeComponent().getLocationOnScreen();
            //            System.out.println(browserLocation);
            Robot robot = new Robot();

            // input password
            robot.mouseMove((int) (browserLocation.getX()) + 988, (int) (browserLocation.getY()) + 181);
            robot.mousePress(InputEvent.BUTTON1_MASK);
            robot.mouseRelease(InputEvent.BUTTON1_MASK);

            for (int i = 0; i < password.length(); i++) {
                char c = password.charAt(i);
                if ('A' <= c && c <= 'Z') {
                    type(robot, c, true);
                } else if ('a' <= c && c <= 'z') {
                    type(robot, c - ('a' - 'A'), false);
                } else if ('0' <= c && c <= '9') {
                    type(robot, c, false);
                } else {
                    if (keyMap.containsKey(c)) {
                        type(robot, keyMap.get(c), false);
                    } else {
                        type(robot, c, false);
                    }
                }
            }

            String captcha = getCaptcha(browserLocation, robot);

            executeJavascript(String.format(doLoginJs, username, captcha));

        } catch (AWTException e1) {
            e1.printStackTrace();
        } catch (IOException e1) {
            e1.printStackTrace();
        }
    }

    private List<BaiduKeywordInfo> collectData() {
        String js = "var tableGroup=getElementsByClassName('table-group','div')[0]; if(tableGroup.children.length>0){return tableGroup.children[0].outerHTML;}else{return null;}";
        String tableGroupString = (String) executeJavascriptWithResult(js);

        if (debug) {
            System.out.println("javascript:" + js);
            System.out.println("tableGroup:" + tableGroupString);
        }

        if (tableGroupString == null) {
            return new ArrayList<BaiduKeywordInfo>();
        }

        return collectData(tableGroupString);
    }

    static List<BaiduKeywordInfo> collectData(String tableGroupString) {
        try {
            Parser parser = new Parser(tableGroupString);

            ExtractKeywordInfoVistor v = new ExtractKeywordInfoVistor();
            parser.visitAllNodesWith(v);
            return v.infoList;
        } catch (ParserException e) {
            e.printStackTrace();
            return new ArrayList<BaiduKeywordInfo>();
        }
    }

    private void output(List<BaiduKeywordInfo> infos, String keyword) {
        BufferedWriter bw = null;
        try {
            bw = new BufferedWriter(new FileWriter(new File(outputFolder, keyword + ".csv")));

            bw.write("\"关键词字面\",\"日均搜索量\",\"展现理由\"\r\n");

            for (BaiduKeywordInfo info : infos) {
                bw.write(info.toString() + "\r\n");
            }

        } catch (IOException e) {
            e.printStackTrace();
        } finally {
            if (bw != null) {
                try {
                    bw.close();
                } catch (IOException e) {
                    e.printStackTrace();
                }
            }
        }
    }

