    private static class ExtractKeywordInfoVistor extends NodeVisitor {

        private boolean          isInTr            = false;

        private int              tdIndex           = -1;

        List<BaiduKeywordInfo>   infoList          = new ArrayList<BaiduKeywordInfo>();

        private BaiduKeywordInfo info;

        private boolean          timeToKeyword     = false;

        private boolean          timeToDailySearch = false;

        /**
         * Called for each <code>Tag</code> visited.
         * @param tag The tag being visited.
         */
        @Override
        public void visitTag(Tag tag) {
            if (tag instanceof TableRow) {
                isInTr = true;
                tdIndex = -1;
                info = new BaiduKeywordInfo();

                return;
            }

            if (isInTr) {
                if (tag instanceof TableColumn) {
                    tdIndex++;
                    return;
                }

                switch (tdIndex) {
                    case 0:
                        if (tag instanceof Span && info.keyword.isEmpty()) {
                            timeToKeyword = true;
                        }

                        break;
                    case 1:
                        if (tag instanceof Span) {
                            if (tag.getAttribute("class").contains("reason_baidu")) {
                                if (!info.reason.isEmpty()) {
                                    info.reason += ",";
                                }
                                info.reason += "百度相关搜索";
                            } else if (tag.getAttribute("class").contains("reason_darkhorse")) {
                                if (!info.reason.isEmpty()) {
                                    info.reason += ",";
                                }
                                info.reason += "黑马";
                            }
                        }

                        break;
                    case 2:
                        if (tag instanceof Div) {
                            timeToDailySearch = true;
                        }
                        break;
                }
            }

        }

        @Override
        public void visitStringNode(Text string) {
            if (timeToKeyword) {
                info.keyword = '[' + string.getText() + ']';
                timeToKeyword = false;
            }
            if (timeToDailySearch) {
                info.dailySearches = string.getText().replace("&lt;", "<");
                timeToDailySearch = false;

                isInTr = false;

                if (!info.keyword.isEmpty()) {
                    infoList.add(info);
                }
            }
        }
    }

